import React from 'react';
import FavoriteBorderRoundedIcon from '@material-ui/icons/FavoriteBorderRounded';
import { red,green } from '@material-ui/core/colors';
import { makeStyles } from '@material-ui/core/styles';
import LocalHospitalIcon from '@material-ui/icons/LocalHospital';
import TimerIcon from '@material-ui/icons/Timer';
import Box from '@material-ui/core/Box';


const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex'
  },
  small: {
    width: theme.spacing(5),
    height: theme.spacing(5),
  },
  large: {
    width: theme.spacing(10),
    height: theme.spacing(10),
  },
}));

export const Stats = ({ friendScore, time }) => {

  const classes = useStyles();

  return (
    <div className={classes.root}>
      <div style={{ display: 'flex', flexDirection: 'row'}}>
        <LocalHospitalIcon style={{ color: '#CFD8DC' }}/>
        <Box fontSize={12} fontFamily="fontFamily" style={{ color: '#000' }}>
          {friendScore}
        </Box>
      </div>

      <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'center', padding: '16px', border: '1px solid lightgrey'}}>
        <TimerIcon style={{ color: '#CFD8DC' }}/>
        <Box fontSize={12} fontFamily="fontFamily" style={{ color: '#000' }}>
          {time}
        </Box>
      </div>

      <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'center', padding: '16px', border: '1px solid lightgrey'}}>
        <TimerIcon style={{ color: '#CFD8DC' }}/>
        <Box fontSize={12} fontFamily="fontFamily" style={{ color: '#000' }}>
          {time}
        </Box>
      </div>

      <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'center', padding: '16px', border: '1px solid lightgrey'}}>
        <TimerIcon style={{ color: '#CFD8DC' }}/>
        <Box fontSize={12} fontFamily="fontFamily" style={{ color: '#000' }}>
          {time}
        </Box>
      </div>
    </div>

  );
}

export default Stats;
